import { BrowserRouter, Route, Routes } from "react-router-dom";
import Authorization from "./components/Autorization/Authorization";

function App() {
  return (
    <BrowserRouter>
      <Routes>
    <div className="App">

        <Route path="/" component={Authorization} />

    </div>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
